function getCourseNames($conn) {
    $sql = "SELECT courseCode, name FROM tblcourse";
    $result = $conn->query($sql);
    $courseNames = array();
    while ($row = $result->fetch_assoc()) {
        $courseNames[] = $row;
    }
    return $courseNames;
}

function getUnitNames($conn) {
    $sql = "SELECT unitCode, name FROM tblunit";
    $result = $conn->query($sql);
    $unitNames = array();
    while ($row = $result->fetch_assoc()) {
        $unitNames[] = $row;
    }
    return $unitNames;
}

function fetchStudentRecordsFromDatabase($conn, $courseCode, $unitCode) {
    $studentRows = array();
    $query = "SELECT * FROM tblattendance WHERE course = '$courseCode' AND unit = '$unitCode'";
    $result = mysqli_query($conn, $query);
    while ($row = mysqli_fetch_assoc($result)) {
        $studentRows[] = $row;
    }
    return $studentRows;
}

$courseCode = isset($_GET['course']) ? $_GET['course'] : '';
$unitCode = isset($_GET['unit']) ? $_GET['unit'] : '';

$studentRows = fetchStudentRecordsFromDatabase($conn, $courseCode, $unitCode);

// Fetch Course Name
$coursename = "";
if (!empty($courseCode)) {
    $result = mysqli_query($conn, "SELECT name FROM tblcourse WHERE courseCode = '$courseCode'");
    if ($row = mysqli_fetch_assoc($result)) {
        $coursename = $row['name'];
    }
}

// Fetch Unit Name
$unitname = "";
if (!empty($unitCode)) {
    $result = mysqli_query($conn, "SELECT name FROM tblunit WHERE unitCode = '$unitCode'");
    if ($row = mysqli_fetch_assoc($result)) {
        $unitname = $row['name'];
    }
}
