<script>
function exportStyledExcel(tableId, filename, course, unit) {
    var table = document.getElementById(tableId);
    var workbook = new ExcelJS.Workbook();
    var worksheet = workbook.addWorksheet("Attendance");
const logoBase64 = 'data:image/png;base64,'; // Use the base64 string here

const logo = workbook.addImage({
    base64: logoBase64,
    extension: 'png',
});

// Insert the logo in the top left corner (A1, B1 cells)
worksheet.addImage(logo, 'A1:A3'); // Adjust size and position as needed

    // Add Title and University Information in Column B
    worksheet.getCell('B1').value = "Republic of the Philippines";
    worksheet.getCell('B1').font = { name: 'Century Gothic', size: 11 };
    worksheet.getCell('B1').alignment = { horizontal: 'center' };

    worksheet.getCell('B2').value = "CAVITE STATE UNIVERSITY";
    worksheet.getCell('B2').font = { name: 'Bookman Old Style', size: 14, bold: true };
    worksheet.getCell('B2').alignment = { horizontal: 'center' };

    worksheet.getCell('B3').value = "Imus Campus";
    worksheet.getCell('B3').font = { name: 'Century Gothic', size: 11, bold: true };
    worksheet.getCell('B3').alignment = { horizontal: 'center' };

    worksheet.getCell('B4').value = "Imus City, Cavite";
    worksheet.getCell('B4').font = { name: 'Century Gothic', size: 10 };
    worksheet.getCell('B4').alignment = { horizontal: 'center' };

    // Add Title
    worksheet.getCell('B5').value = course + " - " + unit + " Attendance";
    worksheet.getCell('B5').font = { bold: true, size: 14 };
    worksheet.getCell('B5').alignment = { horizontal: 'center' };

    let dateGenerated = new Date().toLocaleDateString();
    worksheet.getCell('B6').value = "Date Generated: " + dateGenerated;
    worksheet.getCell('B6').font = { italic: true, size: 12 };
    worksheet.getCell('B6').alignment = { horizontal: 'center' };

    // Blank row for spacing (row 7)
    worksheet.getCell('B7').value = "";

worksheet.getColumn('A').width = 16; // Adjust the width as needed
worksheet.getColumn('B').width = 50; // Adjust the width as needed
worksheet.getColumn('C').width = 16; // Adjust the width as needed
worksheet.getColumn('D').width = 16; // Adjust the width as needed
worksheet.getColumn('E').width = 16; // Adjust the width as needed

    // Add Table Headers
    var headers = table.querySelectorAll("thead tr th");
    var headerRow = worksheet.addRow([]);
    headers.forEach(cell => {
        let headerCell = headerRow.getCell(headerRow.cellCount + 1);
        headerCell.value = cell.textContent.trim();
        headerCell.font = { bold: true, color: { argb: "FFFFFFFF" } };
        headerCell.fill = { type: "pattern", pattern: "solid", fgColor: { argb: "4F81BD" } };
        headerCell.alignment = { horizontal: "center" };
        headerCell.border = { top: { style: 'thin' }, left: { style: 'thin' }, bottom: { style: 'thin' }, right: { style: 'thin' } };
    });

    // Add Table Data
    var rows = table.querySelectorAll("tbody tr");
    rows.forEach(row => {
        let dataRow = worksheet.addRow([]);
        row.querySelectorAll("td").forEach((cell, index) => {
            let cellObj = dataRow.getCell(index + 1);
            let originalText = cell.textContent.trim();
            let textValue = originalText.toLowerCase(); // Convert only for comparison

            // Apply conditional formatting for attendance
            if (textValue === "absent") {
                cellObj.fill = { type: "pattern", pattern: "solid", fgColor: { argb: "FF0000" } }; // Red
                cellObj.value = ""; // Remove text
            } else if (textValue === "present") {
                cellObj.fill = { type: "pattern", pattern: "solid", fgColor: { argb: "00FF00" } }; // Green
                cellObj.value = ""; // Remove text
            } else {
                cellObj.value = originalText; // Keep original case (Fix for Registration No.)
            }

            cellObj.border = { top: { style: 'thin' }, left: { style: 'thin' }, bottom: { style: 'thin' }, right: { style: 'thin' } };
        });
    });

    // Export File
    workbook.xlsx.writeBuffer().then(buffer => {
        var blob = new Blob([buffer], { type: "application/vnd.openxmlformats-officedocument.spreadsheetml.sheet" });
        saveAs(blob, filename + ".xlsx");
    });
}
</script>
</html>
